import React from './node_modules/react';
import styled from './node_modules/styled-components';

function Overworld() {
  return <Wrapper> Da World </Wrapper>;
}

const Wrapper = styled.div`
  border: 1px solid green;
  border-radius: 8px;
  height: 50vh;
  width: 50vw;
`;

export default Overworld;
